import React, { Component } from 'react';
import { FormGroup } from '@blueprintjs/core';
import { Input, Button } from '../../../../common';

class Register extends Component {
  state = {};

  render() {
    return (
      <FormGroup>
        <Input placeholder="Eg. Nabin" class_="f-element-class" label="First Name" />
        <Input placeholder="Eg. Shah" class_="f-element-class" label="Last Name" />
        <Input placeholder="Eg. Male" class_="f-element-class" label="Sex" />
        <Input placeholder="Eg. P@234ty98ov" class_="f-element-class" label="Password" />
        <Button text="Submit" class_="f-element-class" />
      </FormGroup>
    );
  }
}
export default Register;
